import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import styled from 'styled-components';
import { ButtonContainer } from './Button';
import { NavWrapper } from './Nav';
import logo from '../brand.png';

export default class Navbar extends Component {
    render() {
        return(

            //Navbar
            <NavWrapper className="navbar navbar-expand-lg navbar-dark fixed-top">
                <Link to='/'>
                    <h1 class="text-black">Merlin's Potion</h1>
                </Link>

                <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span class="navbar-toggler-icon"></span>
                </button>
                
                <div class="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul class="navbar-nav mr-auto">
                    <li class="nav-item dropdown">
                        <Link to="/" className="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="true">Potions<span class="sr-only">(current)</span></Link>
                        <div class="dropdown-menu" aria-labelledby="navbarDropdown">
                            <a class="dropdown-item" href="#">Action</a>
                            <a class="dropdown-item" href="#">Another action</a>
                        </div>
                </li>



                    <li className="nav-item"><Link to="/" className="nav-link">Mulher</Link></li>
                    <li className="nav-item"><Link to="/" className="nav-link">Infantil</Link></li>
                    <li className="nav-item"><Link to="/" className="nav-link">Contato</Link></li>
                    <li className="nav-item"><Link to="/" className="nav-link">Cadastro</Link></li>
                </ul>
                
                <Link to='/cart' className="ml-auto">
                    <ButtonContainer>
                        <img src="images/cart.png" />
                    </ButtonContainer>
                </Link>
                </div>
            </NavWrapper>
        ); 
    }
}
